O pacto de São José da Costa Rica estabelece o trânsito em julgado e é norma supralegal. A CF estabelece a culpa somente após trânsito em julgado.
A prisão do 312 é cautelar. Já a prisão de 2 grau pressupõe culpa e, se revertida, ensejará indenização.
